Here's the code for assigning white or black to each word in the list:

```python
words = ['coke', 'cannon', 'ice cream', 'grenade', 'phone', 'wallet', 'rifle', 'mace', 'bottle', 'sword', 'walkman', 'camera', 'axe', 'revolver'] 

for word in words:
    if word == 'white':
        print(f"{word}  - white"))
    elif word == 'black':
        print(f"{word}  - black"))
    else:
        print(f"{word}  - unknown"))
```
